import React from 'react'

function Registration () {
    return (
        <div className="reg-container">
            <div className="column"><input class="input" type="text" placeholder="Name" /></div>
            <div className="column"><input class="input" type="number" placeholder="Age" /></div>
            <div className="column"><input class="input" type="text" placeholder="Description" /></div>
            <div className="column"><input class="input" type="text" placeholder="Doggo id" /></div>
            <button className="button is-primary">Submit</button>
        </div>
    )
}

export default Registration
